static byte[] fromLong(final long value, final int numBytes) {
		long shiftedValue = value;
		byte[] res = new byte[numBytes];
		for(int i = 0; i < numBytes; i++) {
			res[i] = (byte) (shiftedValue & BYTE_MASK);
			shiftedValue = shiftedValue >> 8;
		}
		return res;
	}
